import axios from "axios";
import { useEffect } from 'react';

function Posts() {
    useEffect(() => {
        axios.get("http://localhost:3001/posts").then((res) => {
            console.log(res);
        })
    }, []);
  return (
    <div>Posts</div>
  )
}

export default Posts
